import { BrowserRouter, Switch, Route } from 'react-router-dom';
import React, { Component} from 'react'
import Layout from './Layout'
import Page from './Page'

class Acme extends Component {
    render(){
        return(
            <Layout>
                <BrowserRouter>
                    <Switch>
                    <Route exact path="/" component={Page} />
                    </Switch>
                </BrowserRouter>
            </Layout>
        )
    }


}
export default Acme;
